$("#input__file").change(function(){this.files&&$("#image-photo").attr("src",URL.createObjectURL(this.files[0]))});let tbody=$("#table-body"),i=0;$("#btn-add-field").click(function(){++i;$.get("/Collection/AddNewField/",{i:i},function(n){n!==""&&tbody.append(n)})});$("#btn-remove-field").click(function(){i!==-1&&(--i,tbody.children().last().remove())});